import React from 'react';


const Users = (props) => {
    return <div>
        {props.users.map(user => {
            <div key={user.id}>
                <span>
                    <div>
                        <img src={user.photoUrl} />
                    </div>
                    <div>
                        <button>Follow</button>
                    </div>
                </span>
                <span>
                    <div>{user.name}</div>
                    <div>{user.status}</div>
                    <div>{user.location}</div>
                </span>
            </div>
        })}
    </div>
}

export default Users;
